select(2, ...).LoadData("APP_INFO","Global",[[return {version=406,lastSync=1615592859,message={id=0,msg=""},news={{title="TradeSkillMaster v4.10.22 Changelog",content="TSM v4.10.22 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Disenchant value and ratio fixes<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606771565,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-22-changelog/"},{title="TradeSkillMaster v4.10.21 Changelog",content="TSM v4.10.21 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed various issues caused by an erroneous bonusId being tracked<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606760917,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-21-changelog/"},{title="TradeSkillMaster v4.10.20 Changelog",content="TSM v4.10.20 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Added hard-coded vendor sell prices for new crafting materials<br />* [Retail] Updated disenchanting information for SL<br />* Fixed inconsistency between warning popup and app status icon<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606756666,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-20-changelog/"},{title="TradeSkillMaster v4.10.19 Changelog",content="TSM v4.10.19 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Updated prospecting ratios<br />* [Retail] Fixed issue with TSM not showing proper stats on SL items<br />* [Retail] Fixed SL enchanting not working properly<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606423515,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-19-changelog/"},{title="TradeSkillMaster v4.10.18 Changelog",content="TSM v4.10.18 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with auctions not displaying in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606252290,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-18-changelog/"},{title="TradeSkillMaster v4.10.17 Changelog",content="TSM v4.10.17 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with auctions not displaying in some situations<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606249374,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-17-changelog/"},{title="TradeSkillMaster v4.10.16 Changelog",content="TSM v4.10.16 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] Fixed issue with Rich/Light Illusion Dust transformation<br />* [Retail] Fixed issue with tabards showing as disenchantable<br />* [Retail] Fixed some issues with disenchanting ratios<br />* Fixed issue with buying from the vendor<br />* Added `TSM_API.RegisterUICallback` for 3rd-party developers<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1606077005,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-16-changelog/"},{title="TradeSkillMaster v4.10.15 Changelog",content="TSM v4.10.15 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* [Retail] TOC bump for 9.0.2<br />* Fixed tabards showing as disenchantable.<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1605820182,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-15-changelog/"},{title="TradeSkillMaster v4.10.14 Changelog",content="TSM v4.10.14 has been released! If you are running the TSM Desktop Application (and have TSM4 installed), you will be automatically updated momentarily. Otherwise, you can download directly from our site here: <a href='https://www.tradeskillmaster.com/install'>https://www.tradeskillmaster.com/install</a> (or wait for it to show on CurseForge/Twitch &#8211; which may take a few hours).<strong>Changes</strong><br />* Fixed tooltip error when hovering over favorite searches<br />* Fixed error on base group UI after removing a group<br />* Fixed TSM taking a long time on logout for some users<br />* [Retail] Added additional bonusIds<br />* [Retail] Added light/rich illusion dust conversion<br />* [Retail] Updated ink trading for Shadowlands<br />* [Retail] Fixed error when syncing professions between accounts<br />* [Retail] Fixed error when creating profession groups<br />* [Retail] Fixed issue with &#8220;/disenchant&#8221; search filter<strong>Known Issues</strong><br /><a href='http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues'>http://support.tradeskillmaster.com/display/KB/TSM4+Currently+Known+Issues</a>",timestamp=1604257412,link="https://blog.tradeskillmaster.com/tradeskillmaster-v4-10-14-changelog/"}}}]]) --<APP_INFO,Global,1615592859>
